import { createSignal, onMount, JSX, createEffect, onCleanup } from "solid-js";
import avatarMint from "../assets/avatar.png";

const SCRAMBLE_CHARS = "!<>-_\\/[]{}—=+*^?#________";

// Text scrambler animation component
interface TextScramblerProps {
  text: string;
  speed?: number;
}

function TextScrambler(props: TextScramblerProps) {
  const [display, setDisplay] = createSignal("");
  const [iteration, setIteration] = createSignal(0);
  const speed = props.speed ?? 40;

  createEffect(() => {
    const currentIter = iteration();
    const text = props.text;

    const scrambled = text
      .split("")
      .map((char, i) => {
        if (i < currentIter) return char;
        return SCRAMBLE_CHARS[
          Math.floor(Math.random() * SCRAMBLE_CHARS.length)
        ];
      })
      .join("");

    setDisplay(scrambled);

    if (currentIter < text.length) {
      const timer = setTimeout(() => setIteration(currentIter + 1), speed);
      return () => clearTimeout(timer);
    }
  });

  onMount(() => {
    setIteration(0);
  });

  return (
    <div
      class="flex flex-col font-['Inter',sans-serif] font-normal h-[19px] justify-center text-[13.9px] tracking-[0.695px] w-[135px]"
      style={{ color: "var(--text-primary)" }}
    >
      <p class="leading-[normal] whitespace-pre-wrap" dir="auto">
        {display()}
      </p>
    </div>
  );
}

// Rotating words component
interface RotatingWordsProps {
  words: string[];
  speed?: number;
  className?: string;
}

function RotatingWords(props: RotatingWordsProps) {
  const [currentWord, setCurrentWord] = createSignal("");
  const [wordIndex, setWordIndex] = createSignal(0);
  const [charIndex, setCharIndex] = createSignal(0);
  const [isDeleting, setIsDeleting] = createSignal(false);

  const typingSpeed = props.speed ?? 100;
  const deletingSpeed = 50;
  const delayBetweenWords = 2000;

  onMount(() => {
    const type = () => {
      const words = props.words;
      const currentWordText = words[wordIndex()];

      if (isDeleting()) {
        setCurrentWord(currentWordText.substring(0, charIndex() - 1));
        setCharIndex(charIndex() - 1);

        if (charIndex() === 0) {
          setIsDeleting(false);
          setWordIndex((wordIndex() + 1) % words.length);
          setTimeout(type, typingSpeed);
        } else {
          setTimeout(type, deletingSpeed);
        }
      } else {
        setCurrentWord(currentWordText.substring(0, charIndex() + 1));
        setCharIndex(charIndex() + 1);

        if (charIndex() === currentWordText.length) {
          setTimeout(() => {
            setIsDeleting(true);
            type();
          }, delayBetweenWords);
        } else {
          setTimeout(type, typingSpeed);
        }
      }
    };

    type();
  });

  return <span class={props.className || ""}>{currentWord()}</span>;
}

// Animated wrapper component
interface AnimatedProps {
  children: JSX.Element;
  delay?: number;
  duration?: number;
}

function Animated(props: AnimatedProps) {
  const [isVisible, setIsVisible] = createSignal(false);
  const delay = props.delay ?? 0;
  const duration = props.duration ?? 0.6;

  onMount(() => {
    setTimeout(() => setIsVisible(true), delay * 1000);
  });

  return (
    <div
      style={{
        opacity: isVisible() ? 1 : 0,
        transform: isVisible() ? "translateY(0px)" : "translateY(20px)",
        transition: `opacity ${duration}s cubic-bezier(0.25, 0.46, 0.45, 0.94), transform ${duration}s cubic-bezier(0.25, 0.46, 0.45, 0.94)`,
      }}
    >
      {props.children}
    </div>
  );
}

// Profile image component
function ProfileImage() {
  const [isHovered, setIsHovered] = createSignal(false);
  const [isExpanded, setIsExpanded] = createSignal(false);
  const [imageRef, setImageRef] = createSignal<HTMLDivElement | null>(null);
  const [centerOffsetX, setCenterOffsetX] = createSignal(0);

  const handleClick = (e: MouseEvent) => {
    e.stopPropagation();
    setIsExpanded(!isExpanded());
  };

  const originalSize = 60;

  const getResponsiveScale = () => {
    const viewportWidth = window.innerWidth;
    const viewportHeight = window.innerHeight;
    const desktopScale = 7.5;

    if (viewportWidth < 768) {
      const padding = 40;
      const maxScaleX = (viewportWidth - padding) / originalSize;
      const maxScaleY = (viewportHeight - padding) / originalSize;
      return Math.min(maxScaleX, maxScaleY, desktopScale);
    }
    return desktopScale;
  };

  const calculateCenterOffsetX = () => {
    const image = imageRef();
    if (!image) return 0;
    const rect = image.getBoundingClientRect();
    const viewportWidth = window.innerWidth;
    const expandedScale = getResponsiveScale();
    const expandedSize = originalSize * expandedScale;
    const currentX = rect.left;
    const targetCenterX = viewportWidth / 2;
    const targetX = targetCenterX - expandedSize / 2;
    return targetX - currentX;
  };

  onMount(() => {
    setCenterOffsetX(calculateCenterOffsetX());
    const handleResize = () => setCenterOffsetX(calculateCenterOffsetX());
    window.addEventListener("resize", handleResize);
    window.addEventListener("scroll", handleResize);
    return () => {
      window.removeEventListener("resize", handleResize);
      window.removeEventListener("scroll", handleResize);
    };
  });

  createEffect(() => {
    if (isExpanded()) setCenterOffsetX(calculateCenterOffsetX());
  });

  const expandedScale = getResponsiveScale();
  const expandedSize = originalSize * expandedScale;

  return (
    <div
      style={{
        width: "100%",
        position: "relative",
        "margin-bottom": isExpanded()
          ? `${expandedSize - originalSize + 20}px`
          : "0px",
        transition: "margin-bottom 0.4s cubic-bezier(0.25, 0.46, 0.45, 0.94)",
      }}
    >
      <div
        ref={setImageRef}
        class="rounded-[8px] overflow-hidden"
        data-clickable
        onMouseEnter={() => setIsHovered(true)}
        onMouseLeave={() => setIsHovered(false)}
        onClick={handleClick}
        style={{
          width: `${originalSize}px`,
          height: `${originalSize}px`,
          transform: isExpanded()
            ? `translateX(${centerOffsetX()}px) scale(${expandedScale})`
            : isHovered()
              ? "translateX(0) scale(1.05)"
              : "translateX(0) scale(1)",
          "transform-origin": "top left",
          transition: "transform 0.4s cubic-bezier(0.25, 0.46, 0.45, 0.94)",
          "z-index": isExpanded() ? 1000 : 1,
          position: "relative",
        }}
      >
        <img
          src={avatarMint}
          alt="Profile avatar"
          class="w-full h-full object-cover"
          draggable={false}
          style={{ "border-radius": "8px" }}
        />
      </div>
    </div>
  );
}

